/****************************************************************************
* 名    称：GUI_PutHZ_a()
* 功    能：显示汉字功能增强（自带字库）。
* 入口参数：x		指定显示位置，x坐标
*           y		指定显示位置，y坐标
*           dat		要输出显示的汉字点阵数据。
*           hno     要显示此行的点个数
*           lno     要显示此列的点个数
* 出口参数：无
* 说    明：操作失败原因是指定地址超出有效范围。
****************************************************************************/

void GUI_PutHZ_a(uint32 x, uint32 y, uint8 *dat)
{
    unsigned int i;
    i=((*dat-0xa0)*94+(*(dat+1)-0xa0-31))*32;
    if(*dat<0xa1)
    GUI_PutHZ(x,y,(uint8 *)(&chinese[(*dat)*16]),8,16);
    else
    GUI_PutHZ(x,y,(uint8 *)(&chinese[i]),16,16);           
}
#endif
/****************************************************************************
* 名    称：GUI_PutHZ_Num()
* 功    能：以十进制方式显示数字
* 入口参数：x		指定显示位置，x坐标
*           y		指定显示位置，y坐标         
*           lenth   数字的位数。
*           num		要显示的数字          
* 出口参数：返回值为1时表示操作成功，为0时表示操作失败。
* 说    明：操作失败原因是指定地址超出有效范围。(显示格式为6*8)
****************************************************************************/
uint8 const HzNum[]="0123456789";
uint8 GUI_PutHZ_Num(uint32 x, uint32 y, uint8 lenth,uint32 num)
{
   #if FONT16x16_EN>0
   uint8 i;
   /* 参数过滤 */
   if( x>(GUI_LCM_XMAX-8) ) return(0);
   if( y>(GUI_LCM_YMAX-8) ) return(0);
   if(num>0xffffffff )      return(0);
   x+=(lenth-1)*8;
   for(i=lenth;i>0;i--)
   {
       GUI_PutHZ_a(x,y,(uint8 *)&HzNum[num%10]);
       num/=10;
       x-=8;
   }
   #else
   GUI_PutChar_Num(x,y,lenth,num);
   #endif
   return(1);    
}
/****************************************************************************
* 名    称：GUI_PutHZ_strings()
* 功    能：显示汉字串（自带字库）。
* 入口参数：x		指定显示位置，x坐标
*           y		指定显示位置，y坐标
*           dat		要输出显示的汉字点阵数据。
*           hno     要显示此行的点个数
*           lno     要显示此列的点个数
* 出口参数：无
* 说    明：操作失败原因是指定地址超出有效范围。
****************************************************************************/
void GUI_PutHZ_strings(uint32 x, uint32 y, uint8 *dat)
{
    #if FONT16x16_EN>0
    while((*dat!='\0')&&(*dat!='\n'))
    {
        GUI_PutHZ_a(x,y,dat);
        if(*dat<0xa1)
        {
            dat++;
            x+=8;
        }
        else
        {
            dat+=2;
            x+=16;
        }
    }
    #else
    GUI_PutString(x,y,(char *)dat);
    #endif    
}
/****************************************************************************
* 名    称：GUI_Put_Ctrl_String()
* 功    能：在控件中显示字符。
* 入口参数：x		指定显示位置，x坐标
*           y		指定显示位置，y坐标
*           Width   宽度限制
*           High    高度限制
*           str		要显示的ASCII码字符串
* 出口参数：无
* 说    明：操作失败原因是指定地址超出有效范围。
****************************************************************************/
void  GUI_Put_Ctrl_Hz(uint32 x, uint32 y, uint32 Width,uint32 High,char *dat)
{
    #if GUI_CTRL_EN>0  
    #if FONT16x16_EN>0 
    uint8 i=x,j=y;    
    while((*dat!='\0')&&((x-i)<=Width)&&((y-j)<=High))
    { 

        GUI_PutHZ_a(x,y,(uint8 *)dat);
        if(*dat<0xa1)
        {
            dat++;
            x+=8;
        }
        else
        {
            dat+=2;
            x+=16;
        }
        if(*dat=='\n')
        {
            dat++;
            x=i;
            y+=16;
        }
    }
    #else
    GUI_Put_Ctrl_String(x,y,Width,High,dat);
    #endif    
    #endif
}



































































































